import style from "./playingOption.module.css";
export default function PlayingOption() {
  function handleBack() {
    navigate("/");
  }
  return (
    <div className={style.playingOption}>
      <button className={style.backButton} onClick={handleBack}>
        Back
      </button>
      <div className={style.innerContainer}>
        <h1 className={style.h1}>Playing Options</h1>
        <button className={style.button}>Single Player</button>
        <button className={style.button}>Multi Player</button>
      </div>
    </div>
  );
}
